import '../style/TodoListBox.css';
import TodoObject from './todoObject';

const TodoListBoxDB = ( todosDB ) => {
    return (
        <div className='todolist-listbox'>
            {todosDB?.map(todo => (
                <TodoObject
                todo={todo}
                key={todo.id}
                />
            ))}
        </div>
    )
}

export default TodoListBoxDB;
